//importar layouts

import LayoutAdmin from "../layouts/LayoutsAdmin";

//importar admin pages

import AdminHome from "../pages/admin";
import AdminLogin from "../pages/admin/Login";

const routes = [
  {
    path: "/admin",
    component: LayoutAdmin,
    exact: false,
    routes: [
      {
        path: "/admin",
        component: AdminHome,
        exact: true,
      },
      {
        path: "/admin/login",
        component: AdminLogin,
        exact: true,
      },
    ],
  },
];

export default routes;
